    'sexualwarningbody.CEDisclaimer_Body': {value: '<strong>Je\u017Celi cho\u0107 jedno z poni\u017Cszych zda\u0144 o Tobie jest nieprawdziwe, kliknij na strza\u0142k\u0119 "cofnij", aby opu\u015Bci\u0107 t\u0119 cz\u0119\u015B\u0107 OLX:</strong><br /><ul><li>Uko\u0144czy\u0142em/am 18 lat.</li><li>Rozumiem, \u017Ce "anonse erotyczne" zawieraj\u0105 tre\u015Bci dla doros\u0142ych.</li><li>Zgadzam si\u0119 oflagowa\u0107 ka\u017Cde og\u0142oszenie, kt\xF3re jest nielegalne, b\u0105d\u017A \u0142amie inne postanowienia <LinkTermsUse>Regulaminu</LinkTermsUse> OLX.</li><li>Zgadzam si\u0119 powiadomi\u0107 odpowiednie w\u0142adze o podejrzeniach wykorzystywania nieletnich.</li><li>Klikaj\u0105c na poni\u017Cszy link, zwalniam OLX z jakiejkolwiek odpowiedzialno\u015Bci zwi\u0105zanej z moim u\u017Cytkowaniem tej strony.</li></ul>', index: 1208},
