    'sexualwarningbody.SexualWarning_02_Body': {value: '<p><strong>Klikaj\u0105c na "Akceptuj\u0119 Regulamin i chc\u0119 kontynuowa\u0107", o\u015Bwiadczam, \u017Ce:</strong></p><ul><li>Mam uko\u0144czone 18 lat.</li><li>Rozumiem, \u017Ce kategoria towarzyskie mo\u017Ce zawiera\u0107 tre\u015Bci o charakterze seksualnym.</li><li>O\u015Bwiadczam, \u017Ce nie b\u0119d\u0119 zamieszcza\u0142/a wizerunk\xF3w pornograficznych lub ukazuj\u0105cych nago\u015B\u0107, wizerunk\xF3w innych os\xF3b bez ich zgody, wizerunk\xF3w os\xF3b poni\u017Cej 18 roku \u017Cycia, a w szczeg\xF3lno\u015Bci dzieci.</li><li>Akceptuj\u0119 prawa autorskie dotycz\u0105ce wizerunk\xF3w i fotografii.</li><li>Nie umieszcz\u0119 \u017Cadnego og\u0142oszenia zawieraj\u0105cego propozycje lub sugestie us\u0142ug seksualnych w zamian za wynagrodzenie finansowe lub jakiekolwiek inne.</li><li>Zgadzam si\u0119 na oznaczenie jako "zabronione" ka\u017Cdego og\u0142oszenie, kt\xF3re mo\u017Ce by\u0107 nielegalne lub niezgodne z  <a href="%s" onclick="window.open(this.href); return false;"><strong>Warunkami u\u017Cytkowania OLX</strong></a> Ponadto o\u015Bwiadczam, \u017Ce zg\u0142osz\u0119 jakiekolwiek podejrzenia o mo\u017Cliwo\u015Bci wykorzystywania nieletnich odpowiednim organom \u015Bcigania. </li><li>Rozumiem i akceptuj\u0119, \u017Ce OLX nie jest odpowiedzialne za jakiekolwiek nadu\u017Cycia. Jakiekolwiek naruszenia regulaminu b\u0119d\u0105 skutkowa\u0142y usuni\u0119ciem og\u0142osze\u0144, zablokowaniem konta u\u017Cytkownika i mog\u0105 by\u0107 podstaw\u0105 do prowadzenia dalszego dochodzenia przez uprawnione organy \u015Bcigania.</li></ul>', index: 1220},
