    'help.PostingBalloonTip_price_30_415': {value: 'Wprowad\u017A konkurencyjn\u0105 cen\u0119 sprzeda\u017Cy lub wynajmu nieruchomo\u015Bci. Je\u015Bli jest mo\u017Cliwo\u015B\u0107 negocjacji, podaj t\u0119 informacj\u0119 w tre\u015Bci og\u0142oszenia.', index: 4824},
    'help.PostingBalloonTip_price_30_416': {value: 'Wprowad\u017A konkurencyjn\u0105 cen\u0119 samochodu.', index: 4825},
    'help.PostingBalloonTip_price_99_366': {value: 'Podaj cen\u0119, kt\xF3ra jest mo\u017Cliwa do osi\u0105gni\u0119cia i jednocze\u015Bnie zwr\xF3ci uwag\u0119 kupuj\u0105cych. Sprzedaj\u0105c co\u015B za bezcen albo po bardzo wysokiej cenie, nie wzbudzisz du\u017Cego zainteresowania.', index: 4826},
    'help.PostingBalloonTip_price_99_367': {value: 'Zakup nieruchomo\u015Bci wymaga znacznych \u015Brodk\xF3w. Sprawd\u017A ceny nieruchomo\u015Bci w swojej okolicy, tak aby Twoja oferta by\u0142a zgodna z og\xF3ln\u0105 tendencj\u0105, a jednocze\u015Bnie konkurencyjna.', index: 4827},
    'help.PostingBalloonTip_price_99_378': {value: 'Dok\u0142adnie dostosuj cen\u0119 samochodu do jego wieku i stanu technicznego.', index: 4828},
