    'help.PostingBalloonTip_title_30_301': {value: 'Tytu\u0142 og\u0142oszenia powinien by\u0107 podsumowaniem jego tre\u015Bci, np. pok\xF3j dla dziewcz\u0105t w Sao Paulo.', index: 4830},
    'help.PostingBalloonTip_title_30_363': {value: 'Nadaj swojemu og\u0142oszeniu chwytliwy tytu\u0142! Wprowad\u017A rodzaj nieruchomo\u015Bci, nazw\u0119 dzielnicy, liczb\u0119 pokoi, np. dom w M\xF3oca, 3 sypialnie, umeblowany', index: 4831},
