    'help.PostingBalloonTip_title_30_368': {value: 'Nadaj swojemu og\u0142oszeniu chwytliwy tytu\u0142! Wprowad\u017A nazw\u0119 dzielnicy, miasto, powierzchni\u0119, np. sklep w Br\xE1s, S\xE3o Paulo, 180 m\xB2.', index: 4833},
