    'help.PostingBalloonTip_title_30_416': {value: 'Wprowad\u017A mark\u0119, model i inne dane, np. Renault Master Van 2010. W doskona\u0142ym stanie!', index: 4841},
    'help.PostingBalloonTip_title_99_366': {value: 'Nadaj swojemu og\u0142oszeniu elektryzuj\u0105cy tytu\u0142, kt\xF3ry zwr\xF3ci na siebie uwag\u0119 kupuj\u0105cych, np. wspania\u0142y telefon Sony W910i z odtwarzaczem muzyki i kart\u0105 pami\u0119ci 2GB.', index: 4842},
    'help.PostingBalloonTip_title_99_367': {value: 'Dzi\u0119ki temu sprzeda\u017C mo\u017Ce si\u0119 powie\u015B\u0107 lub nie. Zwr\xF3\u0107 uwag\u0119 zainteresowanych, podaj\u0105c szczeg\xF3\u0142owe informacje.Pami\u0119taj, \u017Ce kupuj\u0105cy inwestuje w ten zakup oszcz\u0119dno\u015Bci ca\u0142ego \u017Cycia.', index: 4843},
    'help.PostingBalloonTip_title_99_378': {value: 'Wrrr...!!! Ciekawy tytu\u0142 natychmiast przyci\u0105ga uwag\u0119 kupuj\u0105cych i zach\u0119ca ich do kontaktu z Tob\u0105, np. pi\u0119kna Honda City, czarna ze stylowym, inspiruj\u0105cym profilem i silnikiem o sensacyjnych parametrach.', index: 4844},
    'help.PostingBalloonTip_title_99_379': {value: 'Wrrr...!!! Ciekawy tytu\u0142 natychmiast przyci\u0105ga uwag\u0119 kupuj\u0105cych i zach\u0119ca ich do kontaktu z Tob\u0105, np. pi\u0119kna Honda City, czarna ze stylowym, inspiruj\u0105cym profilem i silnikiem o sensacyjnych parametrach.', index: 4845},
    'help.Postings': {value: 'Og\u0142oszenia', index: 4846},
