    'terms.GeneralInformation_content': {value: 'These Terms and the other policies posted on OLX constitute the complete and exclusive understanding and agreement between you and OLX and govern your use of the Service superceding all prior understandings, proposals, agreements, negotiations, and discussions between the parties, whether written or oral.<br /> The Terms and the relationship between you and OLX shall be governed by the laws of the State of New York without regard to its conflict of law provisions.  You and OLX agree to submit to the personal and exclusive jurisdiction of the courts located within the State of New York.  The failure of OLX to exercise or enforce any right or provision of the Terms shall not constitute a waiver of such right or provision.  If any provision of the Terms is found by a court of competent jurisdiction to be invalid, the parties nevertheless agree that the court should endeavor to give effect to the parties\' intentions as reflected in the provision, and the other provisions of the Terms remain in full force and effect.  YOU AND OLX AGREE THAT ANY CAUSE OF ACTION ARISING OUT OF OR RELATED TO THE OLX WEBSITE MUST COMMENCE WITHIN ONE (1) YEAR AFTER THE CAUSE OF ACTION ACCRUES.  OTHERWISE, SUCH CAUSE OF ACTION IS PERMANENTLY BARRED.', index: 4895},
