    'about.FastAndEasy': {value: 'OLX to szybki i \u0142atwy spos\xF3b na sprzedawanie r\xF3\u017Cnych rzeczy. <strong>Korzystanie z serwisu jest bezp\u0142atne.</strong>.', index: 4952},
    'about.GeneralCounsel': {value: 'G\u0142\xF3wny radca prawny', index: 4953},
    'about.History': {value: 'Historia', index: 4954},
    'about.HistoryText1': {value: 'Serwis OLX zosta\u0142 za\u0142o\u017Cony w 2006 roku przez przedsi\u0119biorc\xF3w internetowych, Fabrice\'a Grind\u0119 i Aleca Oxenforda, w Argentynie. Obecnie jest to jedna z najwi\u0119kszych na \u015Bwiecie platform og\u0142oszeniowych, dost\u0119pna w ponad 40 krajach i 50 j\u0119zykach.', index: 4955},
    'about.HistoryText2': {value: 'Codziennie miliony ludzi na ca\u0142ym \u015Bwiecie korzystaj\u0105 z serwisu OLX, aby kupowa\u0107 i sprzedawa\u0107 samochody i wiele innych rzeczy, znale\u017A\u0107 prac\u0119 czy wynaj\u0105\u0107 dom. Platforma OLX ma ponad 200 milion\xF3w niepowtarzalnych u\u017Cytkownik\xF3w miesi\u0119cznie, co generuje ruch w wysoko\u015Bci 11 miliard\xF3w ods\u0142on miesi\u0119cznie czyli oko\u0142o 360 milion\xF3w ods\u0142on dziennie. Grupa ma 1200 pracownik\xF3w w biurach w Buenos Aires, Cape Town, New Delhi, Sao Paulo, Rio de Janeiro, Lizbonie i Nowym Jorku.', index: 4956},
    'about.HistoryText3': {value: 'Firma Naspers pierwotnie naby\u0142a pakiet 67,8% akcji w sp\xF3\u0142ce OLX.inc w sierpniu 2010 roku, a nast\u0119pnie zwi\u0119kszy\u0142a sw\xF3j udzia\u0142 do 95%. W ramach dzia\u0142a\u0144 zmierzaj\u0105cych do przekszta\u0142cenia serwisu OLX w najwi\u0119ksz\u0105 na \u015Bwiecie gie\u0142d\u0119 typu C2C (klient-klient) firma Naspers niedawno skonsolidowa\u0142a swoje serwisy og\u0142oszeniowe na Filipinach, w Tajlandii, w Polsce, na W\u0119grzech, w Bu\u0142garii, w Rumunii i w Indonezji, zmieniaj\u0105c ich mark\u0119 na OLX.', index: 4957},
