    'about.PostingBalloonTip_description_30_301': {value: 'Wprowad\u017A informacje o nieruchomo\u015Bci , takie jak klimatyzacja, zabudowa, od ulicy / od podw\xF3rza, przy rodzinie, stancja.', index: 4979},
    'about.PostingBalloonTip_Email_0_0': {value: 'Podaj swoje prawdzie imi\u0119, aby kupuj\u0105cy wiedzieli, jak si\u0119 do Ciebie zwraca\u0107. Nie musisz podawa\u0107 nazwiska.', index: 4980},
    'about.Presence': {value: 'Obecno\u015B\u0107', index: 4981},
    'about.SellingIsEasy': {value: 'Sprzedawanie jest \u0142atwe', index: 4982},
    'about.SellThings': {value: 'Sprzedaj sw\xF3j poprzedni telefon kom\xF3rkowy, kt\xF3ry zajmuje tylko miejsce w szufladzie.</br>Sprzedaj gitar\u0119, skoro na niej nie grasz.</br>Sprzedaj w\xF3\u017Cek spacerowy siostry, kt\xF3ry zalega w jej szafie.</br>Sprzedaj sw\xF3j motocykl i kup sobie lepszy.</br>Sprzedaj buty, kt\xF3re na Ciebie nie pasuj\u0105.</br>Sprzedaj samoch\xF3d.</br>', index: 4983},
