    'about.WeekendTakesLonger': {value: 'Akceptacja og\u0142osze\u0144 wys\u0142anych w nocy lub w wekeend mo\u017Ce zaj\u0105\u0107 wi\u0119cej czasu. Nie publikuj tego samego og\u0142oszenia jeszcze raz.', index: 4989},
    'about.WithinTime': {value: '<li>Wystarczy kilka sekund, aby wystawi\u0107 co\u015B na sprzeda\u017C (u\u017Cyj telefonu!)</li><li>Wystarczy kilka minut, aby Twoje og\u0142oszenie pojawi\u0142o si\u0119 w serwisie OLX</li><li>Wystarczy kilka godzin, aby zg\u0142osili si\u0119 pierwsi zainteresowani</li><li>Wystarczy kilka dni, aby si\u0119 z nimi spotka\u0107 i zamieni\u0107 sprzedawan\u0105 rzecz na got\xF3wk\u0119</li><li>Wystarczy kilka tygodni, aby u\u0142atwi\u0107 i poprawi\u0107 swoje \u017Cycie</li>', index: 4990},
    'mail_crm.AntiFraudInfo': {value: '<p style="padding: 0pt 5px;">Aby uzyska\u0107 wi\u0119cej informacji i rad w kwestii bezpiecze\u0144stwa odwied\u017A nasze forum  <a href="<<ForumLink>>">tutaj</a>, lub poszukaj pomocy <a href="<<Help26Link>>">tutaj</a>.', index: 4991},
    'mail_crm.CongratulationsForPostingYourFirstAdOnBrand': {value: 'Gratulujemy publikacji pierwszego og\u0142oszenia w serwisie OLX!', index: 4992},
    'mail_crm.ContactUsLink': {value: '<<CONTACTLINK>>Skontaktuj si\u0119 z  nami<</CONTACTLINK>>', index: 4993},
    'mail_crm.CRM1_Bullet_1': {value: '<<LI_MARGIN_5PX>><strong>NIGDY nie sprzedawaj osobie spoza w\u0142asnego kraju. </strong><br />Przelew z zagranicy mo\u017Ce zaj\u0105\u0107 3 do 4 tygodni, a nawet d\u0142u\u017Cej. W tym czasie kwota przelewu mo\u017Ce by\u0107 widoczna na Twoim rachunku bankowym, ale je\u015Bli przelew oka\u017Ce si\u0119 fa\u0142szywy, zostanie ona usuni\u0119ta.<</LI_MARGIN_5PX>>', index: 4994},
    'mail_crm.CRM1_Bullet_2': {value: '<<LI_MARGIN_5PX>><strong>Nigdy nie przyjmuj zagranicznych czek\xF3w got\xF3wkowych. </strong><br /> Oszu\u015Bci zazwyczaj wysy\u0142aj\u0105 fa\u0142szywe czeki. <</LI_MARGIN_5PX>>', index: 4995},
    'mail_crm.CRM1_Bullet_3': {value: '<<LI_MARGIN_5PX>><strong>NIGDY nie zgadzaj si\u0119 na p\u0142atno\u015B\u0107 wy\u017Csz\u0105 ni\u017C ustalona warto\u015B\u0107 towaru. </strong><br />NIGDY nie zwracaj nadp\u0142aty bez wzgl\u0119du na wyja\u015Bnienie kupuj\u0105cego (prezent, koszty przesy\u0142ki, op\u0142aty celne, koszty banku po\u015Brednika itp.).<</LI_MARGIN_5PX>>', index: 4996},
    'mail_crm.CRM1_Bullet_4': {value: '<<LI_MARGIN_5PX>><strong>Je\u017Celi kupuj\u0105cy przedstawia si\u0119 jako po\u015Brednik (prawnik, konsultant) zagranicznego klienta, ZREZYGNUJ ZE SPRZEDA\u017BY.</strong><</LI_MARGIN_5PX>>', index: 4997},
    'mail_crm.CRM1_Bullet_5': {value: '<<LI_MARGIN_5PX>><strong>OLX nigdy nie po\u015Bredniczy w negocjacjach ani  transakcjach.</strong><br /> Nie po\u015Bredniczymy w p\u0142atno\u015Bciach ani  przesy\u0142kach, nie dajemy gwarancji na zakupione towary i nie oferujemy us\u0142ug finansowych i zabezpiecze\u0144 kupuj\u0105cym ani sprzedaj\u0105cym.<</LI_MARGIN_5PX>>', index: 4998},
    'mail_crm.CRM1_Bullet_6': {value: '<<LI_MARGIN_5PX>><strong>Nigdy nie podawaj swoich danych finansowych, </strong><br />takich jak numer rachunku bankowego, numer ubezpieczenia itd.<</LI_MARGIN_5PX>>', index: 4999},
    'mail_crm.CRM1_Bullet_7': {value: '<<LI_MARGIN_5PX>><strong>Zachowaj szczeg\xF3ln\u0105 ostro\u017Cno\u015B\u0107, je\u015Bli musisz wys\u0142a\u0107 sw\xF3j przedmiot lub skorzystaj us\u0142ugi escrow. </strong><</LI_MARGIN_5PX>>', index: 5000},
    'mail_crm.CRM1_Bullet_8': {value: '<<LI_MARGIN_5PX>><strong>W przypadku otrzymania wiadomo\u015Bci i zdobyciu nagrody i konieczno\u015Bci op\u0142acenia koszt\xF3w jej przes\u0142ania prosimy nie odpowiada\u0107, lecz skontaktowa\u0107 si\u0119 z</strong><<CONTACTLINK>>zespo\u0142em obs\u0142ugi klienta<</CONTACTLINK>><</LI_MARGIN_5PX>>', index: 5001},
    'mail_crm.CRM_FirstPost_02_Body': {value: '<p><strong>Gratulujemy publikacji pierwszego og\u0142oszenia w OLX: <<ItemTitle>></strong></p></p>Zachowaj t\u0119 wiadomo\u015B\u0107. Informacje w niej zawarte mog\u0105 si\u0119 okaza\u0107 przydatne w przysz\u0142o\u015Bci.</p></p>Radzimy zawiera\u0107 transakcje lokalnie. Dzi\u0119ki temu obie strony mog\u0105 si\u0119 spotka\u0107 przed dokonaniem wymiany.</p></p>Je\u015Bli jednak potencjalny sprzedawca/kupuj\u0105cy nie pochodzi z twojego wojew\xF3dztwa, podajemy kilka wskaz\xF3wek o kt\xF3rych warto pami\u0119ta\u0107:</p><ol style="border-top:1px solid #DCDCDC;border-bottom:1px solid #DCDCDC;background-color:#E9E9E9; padding-right:5px;"><li style="margin: 5px 0"><span style="color: #ff6e33;">NIGDY nie sprzedawaj osobie spoza w\u0142asnego Kraju. </span><br />Przelew z zagranicy mo\u017Ce trwa\u0107 3 do 4 tygodni, lub d\u0142u\u017Cej. Przez ten czas niekt\xF3re banki kredytuj\u0105 warto\u015B\u0107 przelewu. Je\u017Celi przelew oka\u017Ce si\u0119 fa\u0142szywy, twoje konto zostanie obci\u0105\u017Cone warto\u015Bci\u0105 kredytowania.</li><li style="margin: 5px 0"><span style="color: #ff6e33;">NIGDY nie zgadzaj si\u0119 na p\u0142atno\u015B\u0107 wy\u017Csz\u0105 ni\u017C ustalona warto\u015B\u0107 towaru. </span><br />NIGDY nie powiniene\u015B pokrywa\u0107 dodatkowych koszt\xF3w, bez wzgl\u0119du na t\u0142umaczenie sprzedawcy (dodatkowy prezent, koszty przesy\u0142ki, koszty po\u015Brednika itp...).</li><li style="margin: 5px 0"><span style="color: #ff6e33;">Je\u017Celi kupuj\u0105cy jest reprezentowany przez po\u015Brednik\xF3w (prawnik, konsultant...), poniewa\u017C jest cudzoziemcem, NIE PODEJMUJ SI\u0118 SPRZEDA\u017BY. </span></li><li style="margin: 5px 0"><span style="color: #ff6e33;">OLX nigdy nie po\u015Bredniczy w negocjacjach lub dokonywanych transakcjach.</span><br />Nie po\u015Bredniczymy w dokonywaniu p\u0142atno\u015Bci czy dostarczaniu towar\xF3w; nie dajemy \u017Cadnych gwarancji na zakupione towary; nie oferujemy \u017Cadnych us\u0142ug finansowych ani zabezpiecze\u0144, ani kupuj\u0105cym, ani sprzedawcom.</li></ol>Wi\u0119cej informacji na ten temat znajdziesz na stronie <a href="<<ForumLink>>">anti-fraud forum</a></li></ol><<AntiFraudForum>> <<AntiFraudHelp>><<ANONYMOUSUSER>></p>\u017Byczymy udanych transakcji w OLX!</p><<FooterMail_01_Support>><br /></p><<REGISTEREDUSER>>', index: 5002},
    'mail_crm.CRM_FirstPost_031_AnonymousUser': {value: '<p style="color:#f00;"><strong>WSKAZ\xD3WKA:</strong></p><p>Nie musisz by\u0107 zarejestrowany aby korzysta\u0107 z OLX. Zalecamy jednak rejestracj\u0119:<br /><ul><li>\u0141atwiej wtedy zarz\u0105dza\u0107 swoimi og\u0142oszeniami.</li><li>Rejestracja jest szybka i darmowa.</li></ul><a href="<<RegisterLink>>">Zarejestruj si\u0119 teraz!</a></p>', index: 5003},
    'mail_crm.CRM_FirstPost_031_RegisteredUser': {value: 'Je\u015Bli nie chcesz otrzymywa\u0107 wskaz\xF3wek z serwisu OLX, wystarczy, \u017Ce  <<ModifEmailNotificationLink>>klikniesz tutaj<</ModifEmailNotificationLink>> i odznaczysz opcj\u0119: Chc\u0119 otrzymywa\u0107 wskaz\xF3wki dotycz\u0105ce kupowania i sprzedawania w serwisie OLX.', index: 5004},
