    'misc.PostingAd_Mob': {value: 'Publikowanie og\u0142oszenia', index: 10431},
    'misc.PostingBalloonTip_Address_0_0': {value: 'Je\u015Bli podasz adres, Twoje og\u0142oszenie b\u0119dzie widoczne na mapie w naszych aplikacjach OLX na urz\u0105dzenia przeno\u015Bne. Je\u015Bli nie chcesz podawa\u0107 swojego dok\u0142adnego adresu, mo\u017Cesz wskaza\u0107 najbli\u017Csze skrzy\u017Cowanie lub adres innego punktu spotka\u0144.', index: 10432},
    'misc.PostingBalloonTip_ContactName_0_0': {value: '<B> Podaj swoje prawdzie imi\u0119, aby kupuj\u0105cy wiedzieli, jak si\u0119 do Ciebie zwraca\u0107. </B><UL><LI>Nie musisz podawa\u0107 nazwiska.</LI></UL>', index: 10433},
    'misc.PostingBalloonTip_Description_0_0': {value: '<B> Podaj szczeg\xF3\u0142owy opis produktu, aby przyspieszy\u0107 sprzeda\u017C! </B><UL><LI> Opisz wszystkie cechy produkt\xF3w lub us\u0142ug, kt\xF3re oferujesz.</LI><LI> Okre\u015Bl r\xF3wnie\u017C preferowan\u0105 form\u0119 kontaktu (przez telefon czy e-mail) oraz metod\u0119 sprzeda\u017Cy.</LI></UL>', index: 10434},
    'misc.PostingBalloonTip_description_0_301': {value: 'Podaj informacje na temat swojej nieruchomo\u015Bci, np. czy jest klimatyzacja, zabudowane szafy, wej\u015Bcie od ulicy czy od podw\xF3rza, domek jednorodzinny czy pensjonat.', index: 10435},
    'misc.PostingBalloonTip_description_0_363': {value: '<B> Podaj szczeg\xF3\u0142owy opis nieruchomo\u015Bci, aby j\u0105 szybciej wynaj\u0105\u0107!</B> <UL><LI> Opisz nieruchomo\u015B\u0107, podaj\u0105c np. jej stan, wielko\u015B\u0107 dzia\u0142ki, liczb\u0119 pokoi na pi\u0119trze, liczb\u0119 pi\u0119ter itp.</LI><LI> Nie zapomnij o takich danych jak czas eksploatacji i stan techniczny.</LI></UL>', index: 10436},
    'misc.PostingBalloonTip_description_0_367': {value: '<B> Podaj szczeg\xF3\u0142owy opis nieruchomo\u015Bci, aby j\u0105 szybciej sprzeda\u0107!</B> <UL><LI> Opisz nieruchomo\u015B\u0107, podaj\u0105c np. jej stan, wielko\u015B\u0107 dzia\u0142ki, liczb\u0119 pokoi na pi\u0119trze, liczb\u0119 pi\u0119ter itp.</LI><LI> Nie zapomnij o takich danych jak czas eksploatacji i stan techniczny.</LI></UL>', index: 10437},
    'misc.PostingBalloonTip_description_0_368': {value: '<B> Podaj szczeg\xF3\u0142owy opis nieruchomo\u015Bci, aby j\u0105 szybciej sprzeda\u0107 / wynaj\u0105\u0107!</B> <UL><LI> Opisz nieruchomo\u015B\u0107, podaj\u0105c np. jej stan, lokalizacj\u0119 i punkty orientacyjne w okolicy.</LI><LI> Napisz, czy jest klimatyzacja, ile jest toalet, jakie o\u015Bwietlenie itp.<LI> Nie zapomnij o takich danych jak czas eksploatacji i stan techniczny.</LI></UL>', index: 10438},
    'misc.PostingBalloonTip_description_0_376': {value: 'Podaj informacje, takie jak pojemno\u015B\u0107 silnika, jakie ma dokumenty, rodzaj paliwa.', index: 10439},
    'misc.PostingBalloonTip_description_0_377': {value: '<B> Podaj szczeg\xF3\u0142owy opis, aby przyspieszy\u0107 sprzeda\u017C! </B><UL><LI> Okre\u015Bl informacje takie jak stan techniczny, parametry i pochodzenie.</LI></UL>', index: 10440},
    'misc.PostingBalloonTip_description_0_378': {value: '<B> Podaj szczeg\xF3\u0142owy opis, aby przyspieszy\u0107 sprzeda\u017C! </B> <UL><LI> Opisz samoch\xF3d, podaj\u0105c informacje o klimatyzacji, skrzyni bieg\xF3w, zamku centralnym, elektrycznie otwieranych oknach, autoalarmie, poduszkach powietrznych, odtwarzaczu muzyki.</LI><LI> Nie zapomnij o takich danych jak okres eksploatacji, stan techniczny i przyczyna sprzeda\u017Cy.</LI></UL>', index: 10441},
