    'misc.ThankYouMessage': {value: 'Gratulacje! Twoja wiadomo\u015B\u0107 zosta\u0142a wys\u0142ana.Im wi\u0119cej og\u0142osze\u0144, na kt\xF3re odpowiesz, tym wi\u0119ksza szansa na znalezienie dobrej okazji.<br /><br />Czy chcesz zobaczy\u0107 inne ciekawe og\u0142oszenia?<<LINK_GO_TO_YOUR_RESULTS>>Przejd\u017A do wynik\xF3w wyszukiwania.<</LINK_GO_TO_YOUR_RESULTS>>', index: 10769},
