    'misc.TipsForBuyers': {value: 'Wskaz\xF3wki dla kupuj\u0105cych:', index: 10773},
    'misc.TipsForBuyersList': {value: '<li>Kupuj lokalnie, aby sprawdzi\u0107 towar, spotka\u0107 si\u0119 ze sprzedaj\u0105cym i zap\u0142aci\u0107 w czasie odbioru lub dostawy. Pami\u0119taj, aby wybra\u0107 bezpieczne miejsce spotkania. </li><li>Najlepszym sposobem na transakcj\u0119 jest jednoczesna wymiana towaru na pieni\u0105dze. </li><li>Popro\u015B o jednoznaczne okre\u015Blenie stanu i ceny towaru oraz sposobu p\u0142atno\u015Bci i dostawy.</li><li>Korzystaj tylko z tych form p\u0142atno\u015Bci, kt\xF3re znasz i kt\xF3rym ufasz.</li><li>Popro\u015B sprzedaj\u0105cego o numer nadania, je\u015Bli produkt zosta\u0142 nadany przesy\u0142k\u0105. </li><li>Popro\u015B sprzedaj\u0105cego o numer telefonu i sprawd\u017A ten numer.</li><li>W przypadku urz\u0105dze\u0144 elektronicznych, samochod\xF3w i rower\xF3w przed zakupem nale\u017Cy sprawdzi\u0107, czy dzia\u0142aj\u0105.</li><li>Sprawd\u017A ceny takiego samego produktu w innych miejscach.</li><li>Nie podawaj swoich informacji finansowych. </li><li>Zawsze kontaktuj si\u0119 ze sprzedaj\u0105cym przy u\u017Cyciu funkcji \u201EWy\u015Blij e-mail sprzedaj\u0105cemu\u201D. Dzi\u0119ki temu b\u0119dziemy Ci\u0119 mogli powiadomi\u0107, je\u015Bli si\u0119 dowiemy o ewentualnej nieuczciwo\u015Bci tego u\u017Cytkownika.</li>', index: 10774},
    'misc.TipsForSellers': {value: 'Wskaz\xF3wki dla sprzedaj\u0105cych:', index: 10775},
    'misc.TipsForSellersList': {value: '<li>Zalecamy pobranie pe\u0142nej odp\u0142atno\u015Bci przy dostawie. Pami\u0119taj, aby wybra\u0107 bezpieczne miejsce spotkania.</li><li>Je\u015Bli kto\u015B chce kupi\u0107 du\u017C\u0105 ilo\u015B\u0107 towaru, sprawd\u017A jego wiarygodno\u015B\u0107.</li><li>Popro\u015B kupuj\u0105cego o numer telefonu i sprawd\u017A ten numer.</li><li>Dopilnuj, aby produkt by\u0142 zgodny z opisem, i nie wprowadzaj\u0105 kupuj\u0105cych w b\u0142\u0105d.</li><li>Nie udost\u0119pniaj swoich informacji finansowych z wyj\u0105tkiem danych potrzebnych do zap\u0142aty.</li>', index: 10776},
