    'mail_crm2.BrandNeverTakesPartInTransactions': {value: '<li><strong>OLX NIGDY nie bierze udzia\u0142u w transakcjach, nawet je\u015Bli sprzedaj\u0105cy tak twierdzi</strong>. Tego rodzaju informacje nale\u017Cy po prostu ignorowa\u0107.<ol><li>Nie bierzemy udzia\u0142u w negocjacjach, transakcji ani dostawie.</li><li>Nie oferujemy us\u0142ug p\u0142atniczych, ochrony kupuj\u0105cego ani po\u015Bwiadcze\u0144 o sprzedawcach.</li><li>Je\u017Celi otrzymasz wiadomo\u015B\u0107, kt\xF3ra pozornie pochodzi od serwisu OLX, gwarantuj\u0105c\u0105 transakcj\u0119 b\u0105d\u017A dostaw\u0119, ODM\xD3W  realizacji tej transakcji.</li></ol></li>', index: 11422},
    'mail_crm2.crm_ContactSeller_Body1': {value: 'W\u0142a\u015Bnie zosta\u0142a wys\u0142ana Twoja pierwsza odpowied\u017A na og\u0142oszenie opublikowane w OLX. Chcieliby\u015Bmy skorzysta\u0107 z tej okazji, aby poradzi\u0107 Ci, w jaki spos\xF3b bezpiecznie zawiera\u0107 transakcje.<br /><br />Po pierwsze radzimy spotka\u0107 si\u0119 ze sprzedawc\u0105, aby sprawdzi\u0107 jego wiarygodno\u015B\u0107 i jako\u015Bci produktu. Jest to najefektywniejszy i najbezpieczniejszy spos\xF3b post\u0119powania.<br /><br />Oto kilka porad na wypadek, gdyby bezpo\u015Brednie spotkanie nie by\u0142o mo\u017Cliwe:<br /><br />', index: 11423},
    'mail_crm2.crm_ContactSeller_Body2': {value: '<li><strong>GRATISY</strong> w postaci sprz\u0119tu RTV, samochod\xF3w, motocykli, rasowych zwierz\u0105t itp. <strong>NIE ISTNIEJ\u0104</strong>.<br />Tego rodzaju oferty s\u0105 pr\xF3b\u0105 oszustwa, szczeg\xF3lnie je\u015Bli przedmioty te s\u0105 za granic\u0105, a Ty masz zap\u0142aci\u0107 "JEDYNIE" koszty transportu.</li><br /><li><strong>NIE KUPUJ</strong> pojazd\xF3w, je\u015Bli sprzedaj\u0105cy twierdzi, \u017Ce nie znajduj\u0105 si\u0119 w Twoim kraju (niezale\u017Cnie od uzasadnienia).</li><br /><li>P\u0142askoekranowe telewizory, aparaty fotograficzne i nowe komputery oferowane z <strong>50-75% obni\u017Ck\u0105 ceny w innym kraju, nie s\u0105 prawdziwe</strong>.</li><br /><li><strong>Zachowaj ostro\u017Cno\u015B\u0107</strong>, je\u015Bli skontaktuje si\u0119 z Tob\u0105 sprzedawca s\u0142abo m\xF3wi\u0105cy po polsku. Og\xF3lnie nie warto jest odpowiada\u0107 na og\u0142oszenia opublikowane w innym j\u0119zyku ni\u017C Tw\xF3j w\u0142asny.</li><br /><li><strong>Nie kupuj zwierz\u0105t z zagranicy</strong>. Przestrzegaj obowi\u0105zuj\u0105cych przepis\xF3w prawa. Handel niekt\xF3rymi egzotycznymi gatunkami jest zabroniony.</li><br /><li><strong>OLX NIGDY nie bierze udzia\u0142u w transakcjach, nawet je\u015Bli sprzedaj\u0105cy tak twierdzi</strong>. <ol><li>Nie bierzemy udzia\u0142u w negocjacjach, transakcji ani dostawie.</li><li>Nie oferujemy us\u0142ug p\u0142atniczych, ochrony kupuj\u0105cego ani po\u015Bwiadcze\u0144 o sprzedawcach.</li><li>Je\u017Celi otrzymasz wiadomo\u015B\u0107, kt\xF3ra pozornie pochodzi od serwisu OLX, gwarantuj\u0105c\u0105 transakcj\u0119 b\u0105d\u017A dostaw\u0119, ODM\xD3W  udzia\u0142u w tej transakcji.</li></ol></li>', index: 11424},
    'mail_crm2.crm_ContactSeller_Body3': {value: '<br /><<AntiFraudForum>> <<AntiFraudHelp>><br />\u017Byczymy udanej transakcji.<br /><br />', index: 11425},
    'mail_crm2.crm_ContactSeller_Subject': {value: 'Wiadomo\u015B\u0107 automatyczna - Nie odpowiadaj na ni\u0105: Twoja odpowied\u017A na og\u0142oszenie: <<ItemTitle>>', index: 11426},
    'mail_crm2.DearUser': {value: 'Drogi u\u017Cytkowniku,', index: 11427},
    'mail_crm2.DoNotPurchaseAnimalsFromOutsideYourCountry': {value: '<li><strong>Nie kupuj zwierz\u0105t z zagranicy</strong>. Przestrzegaj obowi\u0105zuj\u0105cych przepis\xF3w prawa. Handel niekt\xF3rymi egzotycznymi gatunkami jest zabroniony.</li>', index: 11428},
