    'mail_crm2.NeverPayTheSellerForDeliveringAnAnimalToYou': {value: '<li><strong>NIGDY</strong> nie p\u0142a\u0107 sprzedaj\u0105cemu z g\xF3ry za dostarczenie Ci zwierz\u0119cia. Zwierz\u0119 to prawdopodobnie nie istnieje. Jest to tylko pretekst, by wy\u0142udzi\u0107 pieni\u0105dze.</li>', index: 11430},
    'mail_crm2.NeverPayThroughWesternUnionEspeciallySomeoneWhoIsAbroad': {value: '<li><strong>NIGDY nie dokonuj p\u0142atno\u015Bci za po\u015Brednictwem Western Union</strong> zw\u0142aszcza komu\u015B, kto znajduje si\u0119 za granic\u0105.</li>', index: 11431},
    'mail_crm2.ThereAreNoGiftsOfValuableAnimals': {value: '<li><strong>GRATISY W POSTACI RASOWYCH ZWIERZ\u0104T NIE ISTNIEJ\u0104.</strong> TEGO RODZAJU OFERTA JEST najprawdopodobniej pr\xF3b\u0105 oszustwa, zw\u0142aszcza je\u015Bli (nieistniej\u0105ce) zwierz\u0119 jest za granic\u0105 i masz "JEDYNIE" op\u0142aci\u0107 jego transport.</li>', index: 11432},
    'mail_crm2.WeRecommendYouMeetTheSellerToSeeExistenceAndHealthOfAnimal': {value: 'Przede wszystkim radzimy Ci spotka\u0107 si\u0119 ze sprzedawc\u0105 by upewni\u0107 si\u0119 o istnieniu i dobrym zdrowiu sprzedawanego zwierzaka. Jest to najlepszy i najbezpieczniejszy spos\xF3b przeprowadzania transakcji.', index: 11433},
