    'featured_listings.AdditionalTermsForFeaturedAds_content': {value: 'Dodatkowe Zasady, obok <<LINK_TERMS_USE>>Regulaminu <</LINK_TERMS_USE>> OLX, omawiaj\u0105 kwestie zwi\u0105zane z korzystaniem z Og\u0142osze\u0144 Wyr\xF3\u017Cnionych:<br /><ul><li>Jedynym dowodem zap\u0142aty za Og\u0142oszenie Wyr\xF3\u017Cnione wydawanym przez OLX jest "Potwierdzenie Zam\xF3wienia", kt\xF3re zobaczysz po dokonaniu op\u0142aty, oraz potwierdzenie mailowe.</li><li>Je\u015Bli z jakiego\u015B powodu, natury technicznej, b\u0105d\u017A innej, Twoje og\u0142oszenie nie pojawia si\u0119 w obszarze og\u0142osze\u0144 wyr\xF3\u017Cnionych, jednym zobowi\u0105zaniem OLX jest zamieszczenie og\u0142oszenia w obszarze og\u0142osze\u0144 wyr\xF3\u017Cnionych tak szybko, jak to mo\u017Cliwe i wykonalne.</li><li>Nasz system p\u0142atniczy dostarczany jest przez zewn\u0119trzn\u0105 firm\u0119 .</li><li>Wed\u0142ug uznania OLX, wszelkie og\u0142oszenia, zawieraj\u0105ce tre\u015Bci pornograficzne, uznane za obra\u017Aliwe, spamerskie (wielokrotnie powt\xF3rzone), b\u0119d\u0105ce pr\xF3b\u0105 oszustwa lub naruszaj\u0105ce jakiekolwiek prawa autorskie nie b\u0119d\u0105 wyr\xF3\u017Cnione, a op\u0142ata za nie nie b\u0119dzie zwracana.</li><li>US\u0141UGA WYR\xD3\u017BNIANIA OG\u0141OSZE\u0143 JEST DOSTARCZANA W STANIE W JAKIM JEST I W MIAR\u0118 DOST\u0118PNO\u015ACI, BEZ \u017BADNYCH GWARANCJI JAKIEJKOLWIEK NATURY,  W NAJSZERSZYM PRAWNIE DOPUSZCZALNYM ZAKRESIE.  OLX NIE GWARANTUJE, NIE SK\u0141ADA \u017BADNYCH O\u015AWIADCZE\u0143 W KWESTII, ANI NIE PONOSI \u017BADNEJ ODPOWIEDZIALNO\u015ACI ZA DOK\u0141ADNO\u015A\u0106 I ZUPE\u0141NO\u015A\u0106 ZAWARTO\u015ACI OG\u0141OSZE\u0143 WYR\xD3\u017BNIONYCH.</li></ul>', index: 11496},
