    'featured_listings.OffensivePornographicSpamAdsWillNotBeFeaturedOrReimbursed': {value: 'Og\u0142oszenia obra\u017Aliwe, pornograficzne, spamerskie (powt\xF3rzone), b\u0119d\u0105ce potencjalnym oszustwem lub \u0142ami\u0105ce prawa autorskie nie b\u0119d\u0105 wyr\xF3\u017Cniane, a op\u0142aty za nie nie b\u0119d\u0105 zwracane.', index: 11565},
