    'featured_listings.PublicationMoreThanAMonthFeaturingNotAllowed': {value: 'Twoja publikacja ju\u017C ponad miesi\u0105c jest widoczna na online, prosz\u0119 j\u0105 aktualizowa\u0107 przed opublikowaniem jej na OLX. To tylko zajmie minut\u0119.', index: 11569},
    'featured_listings.ResultsMayVaryFromPostingToPostingAndAreNotGuaranteed': {value: '* Wyniki og\u0142osze\u0144 wyr\xF3\u017Cnionych mog\u0105 si\u0119 r\xF3\u017Cni\u0107 i nie s\u0105 gwarantowane.', index: 11570},
