    'featured_listings.StillHaveQuestions_content': {value: 'W razie innych pyta\u0144, komentarzy czy sugestii, mo\u017Cesz <<CONTACTLINK>>napisa\u0107 do Obs\u0142ugi Klienta<</CONTACTLINK>>.', index: 11574},
    'featured_listings.TermsAndConditions': {value: 'Regulamin', index: 11575},
    'featured_listings.TermsOfService': {value: 'Regulamin', index: 11576},
    'featured_listings.TermsOfService_content': {value: 'Regulamin ten dotyczy korzystania z Og\u0142osze\u0144 Wyr\xF3\u017Cnionych i obowi\u0105zuje  \u0142\u0105cznie z naszym g\u0142\xF3wnym Regulaminem.<br /><ul><li>Jako dow\xF3d dokonania zap\u0142aty za Og\u0142oszenie Wyr\xF3\u017Cnione, OLX generuje jedynie "Potwierdzenie zam\xF3wienia", kt\xF3re zobaczysz pod koniec procesu p\u0142atno\u015Bci oraz potwierdzenie mailowe.</li><li>Je\u015Bli z jakiego\u015B powodu, natury technicznej lub innej, Twoje og\u0142oszenie nie wy\u015Bwietla si\u0119 w\u015Br\xF3d "Og\u0142osze\u0144 Wyr\xF3\u017Cnionych" , nasza odpowiedzialno\u015B\u0107 ogranicza si\u0119 do zamieszczenia go jak najszybciej, jak to mo\u017Cliwe.</li><li><<CLICK_AND_BUY_LINK>><<CLICK_AND_BUY>><</CLICK_AND_BUY_LINK>> dostarcza nam us\u0142ug zwi\u0105zanych z p\u0142atno\u015Bciami.</li><li>Wszystkie dane zgromadzone za po\u015Brednictwem tych us\u0142ug s\u0105 zabezpieczone nasz\u0105 polityk\u0105 prywatno\u015Bci.</li><li>Og\u0142oszenia obra\u017Aliwe, pornograficzne, spamerskie, b\u0119d\u0105ce potencjalnym oszustwem lub \u0142ami\u0105ce prawa autorskie nie b\u0119d\u0105 wyr\xF3\u017Cniane.</li></ul>', index: 11577},
