    'featured_listings.UnableToFeature_NoImages': {value: 'Mo\u017Cesz promowa\u0107 swoje og\u0142oszenie tylko je\u015Bli zawiera przynajmniej jedno zdj\u0119cie. Prosimy o aktualizacj\u0119 og\u0142oszenia. Zajmie to tylko minut\u0119.', index: 11584},
    'featured_listings.UnableToFeature_NoImages_NoPrice': {value: 'Mo\u017Cesz promowa\u0107 swoje og\u0142oszenie tylko, je\u015Bli podasz cen\u0119 i co najmniej jedno zdj\u0119cie. Prosz\u0119 zaktualizowa\u0107 swoje og\u0142oszenie. To zajmie ci tylko kilka minut.', index: 11585},
    'featured_listings.UnableToFeature_NoImages_NoPrice_Outdated': {value: 'Twoja publikacja jest wy\u015Bwietlana online ju\u017C ponad miesi\u0105c, prosz\u0119 j\u0105 zaktualizowa\u0107 przed opublikowaniem jej na OLX. To tylko zajmie minut\u0119. Musisz tak\u017Ce okre\u015Bli\u0107 cen\u0119 i doda\u0107, co najmniej jedno zdj\u0119cie zanim opublikujesz swoje og\u0142oszenie.', index: 11586},
